const Services = (props) => {
  return (
    <ul className="grid grid-cols-2 gap-x-4 gap-y-8 sm:grid-cols-3 sm:gap-x-6 lg:grid-cols-3 xl:gap-x-8">
      {props.phones.map((phone) => (
        <li key={phone.id} className="relative">
          <div className="group block w-full aspect-w-5 aspect-h-3 rounded-lg bg-gray-100 focus-within:ring-2 focus-within:ring-offset-2 focus-within:ring-offset-gray-100 focus-within:ring-indigo-500 overflow-hidden">
            <img src={phone.img} alt="" className="object-cover pointer-events-none group-hover:opacity-75" />
            <button type="button" className="absolute inset-0 focus:outline-none">
              <span className="sr-only">View details for {phone.title}</span>
            </button>
          </div>
          <p className="mt-2 block text-sm font-medium text-gray-900 truncate pointer-events-none">{phone.title}</p>
          <p className="block text-sm font-medium text-gray-500 pointer-events-none">{phone.price}</p>
        </li>
      ))}
    </ul>
  )
}

export default Services;
